package sajin

import kotlin.test.Test
import kotlin.test.assertTrue

class LibraryTest {
    @Test fun softCompareMethodWorks() {
        val i1 = ""
        val i2 = ""
        val value = Sajin.softCompare(i1, i2, 10)
        println("Precision of $value%")
        assertTrue(value > 99)
    }

    @Test fun midCompareMethodWorks() {
        val i1 = ""
        val i2 = ""
        val value = Sajin.midCompare(i1, i2, 10)
        println("Precision of $value%")
        assertTrue(value > 99)
    }

    @Test fun hardCompareMethodWorks() {
        val i1 = ""
        val i2 = ""
        val value = Sajin.hardCompare(i1, i2)
        println("Precision of $value%")
        assertTrue(value > 99)
    }
}
